pub fn find_callers(&self, node_id: &str) -> Vec<&CodeNode> {
        if let Some(incoming) = self.incoming_edges.get(node_id) {
            incoming
                .iter()
                .filter(|rel| rel.relationship_type == RelationshipType::Calls)
                .filter_map(|rel| self.nodes.get(&rel.from_id))
                .collect()
        } else {
            Vec::new()
        }
    }

