fn is_inside_impl_block(&self, node: Node) -> bool {
        let mut current = node;
        let mut parent_iter = current.parent();

        while let Some(parent) = parent_iter {
            if parent.kind() == "impl_item" {
                return true;
            }

            current = parent;
            parent_iter = current.parent();
        }

        false
    }

