pub fn get_node_text(node: Node, source: &str) -> String {
    let start_byte = node.start_byte();
    let end_byte = node.end_byte();

    if start_byte >= source.len() || end_byte > source.len() {
        return String::new();
    }

    source[start_byte..end_byte].to_string()
}

