                    } else {
                        NodeType::Class
                    };

                    let code_node = common::create_node(
                        node_type,
                        name,
                        file_path.to_str().unwrap_or(""),
                        (start_line, end_line),
                        node_content,
                    );

                    code_units.push(code_node);
                }
            }
        } else {
            warn!("Failed to parse Ruby file: {:?}", file_path);
        }

        code_units
    }

