fn extract_variable_references(
        &self,
        content: &str,
        func_range: (usize, usize),
        var_name: &str,
    ) -> Vec<(usize, usize)> {
        let mut references = Vec::new();

        if let Some((tree, _)) = common::parse_with_tree_sitter(content, Path::new("temp.ts")) {
            let reference_nodes = common::execute_query(
                queries::REFERENCE_QUERY,
                &tree,
                content.as_bytes(),
                "reference",
            );

            for node in reference_nodes {
                let ref_line = node.start_position().row + 1;

                // Check if reference is within function range
                if ref_line >= func_range.0 && ref_line <= func_range.1 {
                    let ref_name = common::get_node_text(node, content);
                    if ref_name == var_name {
                        references.push((ref_line, node.end_position().row + 1));
                    }
                }
            }
        }

        references
    }

a3fe312b-6fd7-4b80-94e0-d4b9dd102e7e.content:
fn extract_module_name_from_path(path: &str) -> Option<String> {
    let path = path.trim_matches(|c| c == '"' || c == '\'' || c == '`');

    let components: Vec<&str> = path.split(&['/', '\\', '.', ':', ';']).collect();
    let last_component = components.last()?;

    let module_name: String = last_component
        .chars()
        .filter(|c| c.is_alphanumeric() || *c == '_')
        .collect();

    if module_name.is_empty() {
        None
    } else {
        Some(module_name)
    }
}

d8e183a8-1a79-47fa-a047-4364201452c0.content:
fn find_variable_scope(&self, node: Node) -> Option<String> {
        let mut current = node;
        while let Some(parent) = current.parent() {
            match parent.kind() {
                "function_item" => {
                    for i in 0..parent.named_child_count() {
                        if let Some(child) = parent.named_child(i) {
                            if child.kind() == "identifier" {
                                return Some(format!("function:{}", self.get_node_text(child)));
                            }
                        }
                    }
                }
                "impl_item" => {
                    for i in 0..parent.named_child_count() {
                        if let Some(child) = parent.named_child(i) {
                            if child.kind() == "type_identifier" {
                                return Some(format!("impl:{}", self.get_node_text(child)));
                            }
                        }
                    }
                }
                "struct_item" => {
                    for i in 0..parent.named_child_count() {
                        if let Some(child) = parent.named_child(i) {
                            if child.kind() == "identifier" {
                                return Some(format!("struct:{}", self.get_node_text(child)));
                            }
                        }
                    }
                }
                "source_file" => {
                    return Some("global".to_string());
                }
                _ => {}
            }
            current = parent;
        }
        Some("unknown".to_string())
    }

